import React from "react";
import "./TimeLine.css";

function TimeLine() {
  return (
    <div className="timeline_container">
      <img
        className="timeline_left"
        src="../public/images/timeline-left.png"
      ></img>
      <img
        className="timeline_center"
        src="../public/images/timeline-center.png"
      ></img>
      <img
        className="timeline_right"
        src="../public/images/timeline-right.png"
      ></img>
    </div>
  );
}

export default TimeLine;
